import logoVolkswagen from "../../../../assets/img/volkswagen.png";
import logoSamsung from "../../../../assets/img/samsung.png";
import logoAdidas from "../../../../assets/img/adidas.png";

import './parceiros.scss';

const Parceiros = props => {

   // const partners = props.partners

  return (
     <section className="boxParceiros">
        <h4 className="titleParceiros">Nossos Parceiros</h4>
         <div className="logoParceiros">
         {/* {partners ? 
            partners.map((image_url, image_id) => <img key={image_id} src={image_url} alt="logo Parceiro" />)    
            :
            <> */}
               <img className="logoGoogle" src={logoGoogle} alt="logo Google" />
               <img className="logoVolkswagen" src={logoVolkswagen} alt="logo Volkswagen" />
               <img className="logoSamsung" src={logoSamsung} alt="logo Samsung" />
               <img className="logoAdidas" src={logoAdidas} alt="logo Adidas" />
            {/* </>
         } */}
         </div>
     </section>
  );
};


export default Parceiros;
